import React, { useState, useEffect } from "react";
import './ParkInfo.css';

const ParkInfo = () => {

    const [parkInfos, setParkInfos] = useState([]);

    const getParkInfos = async() => {
            const response = await fetch("http://localhost:8000/parkinfo");
            const jsonData = await response.json();
            setParkInfos(jsonData);

    };

    useEffect(() => {
        getParkInfos();
    });

    return (
        <>
            <div className="ops-box-container">
                <div className="left-text-container">
                    <h2>Hours</h2>
                    <div class="custom-select" style="width:200px;">
  <select>
    <option value="0">Select car:</option>
    <option value="1">Audi</option>
    <option value="2">BMW</option>
    <option value="3">Citroen</option>
    <option value="4">Ford</option>
    <option value="5">Honda</option>
    <option value="6">Jaguar</option>
    <option value="7">Land Rover</option>
    <option value="8">Mercedes</option>
    <option value="9">Mini</option>
    <option value="10">Nissan</option>
    <option value="11">Toyota</option>
    <option value="12">Volvo</option>
  </select>
</div>
                        <table id="hours">
                            <thead>
                            <tr>
                                <th>Park #</th>
                                <th>City</th>
                                <th>Country</th>
                                <th>Hours</th>
                            </tr>
                            </thead>
                            <tbody>
                            {parkInfos.map(parkInfo => (
                                                <tr>
                                                    <td>{parkInfo.id}</td>
                                                    <td>{parkInfo.city}</td>
                                                    <td>{parkInfo.country}</td>
                                                    <td>{parkInfo.hours}</td>
                                                </tr>
                                            ))}

                            </tbody>
                        </table>
                </div>
            </div>
        </>
    )
};

export default ParkInfo;
